import React from 'react'
import { Menu } from "@material-ui/icons"
import './style.css'
export class index extends React.Component {
	constructor(props){
		super(props);
	}
	render() {
		return (
			<div className="shop">
				<div className="topbar">
					<div className="toggle">
						<Menu />
					</div>
				</div>
			</div>
		)
	}
}

export default index
